void mainImage( out vec4 O, in vec2 fc ){
    vec2 uv = fc/iResolution.xy + vec2(1.5, -.5);    
    float t = 12.3456 + iTime,
    w = cos(uv.x * 5. + t * 3.7),
    f = floor(uv.y * 7.5 + w) * 10.,
    g = floor((uv.x + 1.5) * 7.5 + w) * 10.,
    b = sin(uv.y * 1.5)*10.0,
    z = 37.37 * uv.x + t * f;
    z += iMouse.z > 0.0 ? 0.0 : g ;
    b += uv.y * 10.;
    float k = sin(z + uv.y - b ) * 10. ;
    O = vec4(k);
}
